		const Say = () => { console.log("hey my name is aakash bandhu aryal ")};
		
		return(
		<div>
		<h1>hey {detail[0]}</h1>
		<h2>hi {detail[1]}</h2>
		<button onClick={Say()}>reapot</button>
		</div>
		)
}
export default App;
